import {Switch, Route} from 'react-router-dom';

const Products = () => {
  return (
    <div className='Products'>
      Products
      <Switch>
        <Route exact path='/' component={Home}/>
      </Switch>
      <Link to='/'>Wroc</Link>
    </div>
  );
}

export default Products;
